import React from "react";
import './Home.css';
import Title from './images/Title.svg';


    const Home = () => {
        return (<div>
            <img src={Title} alt="Africa bégué Desktop"></img>
            <h3>Entrez dans la Danse !</h3>
            <img rc="./images/logo1.svg"></img>
        </div>
        )
        }

export default Home;
